            "text": "5.1.3 Trustee Shifs: Trusting Information on Social Media or Trust-ing the Social Media Platform Itself ?  Social media websites are in-formation  platforms  where  various  user-created  information  is assembled. Users typically need to sort through posts to determine the trustworthiness of each piece of information. In this scenario, the individual pieces of information (e.g.,  an article, a video,  or a social media feed or tweet) are considered the trustee (i.e., the trusted party). However, for some participants, the focus was on the trustworthiness of the social media platform(s) itself, rather than the trustworthiness of the information within the platform. In essence, participants’ past experiences with misinformation on social media platforms has produced a generalized distrust for these platforms in their entirety. As such, the trustee shifts from the pieces of infor-mation to the social media platforms themselves. Once this occurs, distrust is ingrained into the trustor (i.e., information consumer), which consequently makes rebuilding trust more challenging. Here, we discuss the mechanism through which the trustee shifts from pieces of information to the social media platform(s). We also refect on why it is important to unpack this trustee shift, as well as its implications in section 6. "
