        "content": {
            "text": "3 METHOD This paper is part of a larger project examining information prac-tices and attitudes during COVID-19 and how these practices and attitudes vary across populations. We specifcally focus on popula-tions that have experienced disproportionate COVID-19 morbidity, mortality, and hardship, such as low-SES adults [2]. Upon approval from  the  Institutional  Review  Board  at  our  institution,  we  con-ducted a mixed method study that included a longitudinal survey with 177 adults and interviews with 21 participants who completed all waves of the survey study. The use of mixed methods enables triangulation, an approach to analyze results from the same study using diferent methods of data collection [41]. Triangulation helps enhance the validity of our research and creates a more in-depth picture of understanding the social and technological dimensions of people’s information practices amidst the COVID-19 pandemic. Below we detail the methods used in the survey (subsection 3.1) and interview (subsection 3.2) components of this project. 3.1 Survey Study We  conducted  a  longitudinal  survey  from  September  1,  2020  to December 21, 2020. The focus of our survey was to examine peo-ple’s information seeking behaviors amidst COVID-19. Given the rapid progression of the pandemic in 2020, we expected that indi-viduals’ information practices would also change over time, which includes shifts in the platforms used to obtain COVID-19 infor-mation as well as the information received. Further, while other studies have shown how demographic diferences exist in infor-mation practices [30, 92], our work seeks to identify how these diferences relate to information about COVID-19. Therefore, our survey design was guided by the following overarching research questions: 1) how do people’s information practices change over time?  and  2)  what  demographic  variations  exist  in  information practices, and how do these variations difer in relation to trust and distrust towards COVID-19 information? "
        },
