        "content": {
            "text": "Our triangulated data sheds light on an important research gap regarding the relationship between trust and information consump-tion. A vast majority of previous work has explored the relation-ship  between  trust  and  information  practices  by  assessing  indi-viduals’ use of information sources to obtain COVID-19 informa-tion [28, 50, 56, 60, 96, 98]. For example, prior research has explored the relationship between perceived trust and information sources by frst identifying if individuals “use” (e.g., [98]) or “follow” (e.g., [56]) a particular source to obtain COVID-19 information. However, we argue that great care must be taken in what is inferred from the an-swers to those questions. For example, while prior work has drawn conclusions about what information sources people “rely on” based on where they have gotten information from [45, 84, 96], our results paint a diferent picture. Specifcally, we found that despite report-ing that they get COVID-19 information on social media, many of our interviewees did not trust this information and did not rely on it to make decisions. This raises questions about what it means to “rely” on information (e.g., simply assessing reliance as the extent to which information is gathered from a source versus how much it is used to make decisions). Such concepts must be clearly defned and measured to support accurate and robust knowledge building around these phenomena. Furthermore, our nuanced understanding of participants’ use of and trust in information was surfaced only as we triangulated our survey and interview data, with our interviews allowing us to probe the trends arising in our survey. As such, we make two recommendations. First, mixed method studies are es-sential for truly unpacking the dynamics of information trust and distrust formation. Second, given the diferent measurements and word choices used in current COVID-19 survey studies, we believe a meta-review that characterizes the varied approaches to assessing information practices, reliance, and trust would be benefcial for future research. "
        },
